import { useState } from "react";

export default (req,res)=>{
    const [value,setValue] = useState({
        nombre:'',
        apPat:'',
        apMat:''
    });

    return (<div>
        <h3>Editar</h3>

        <InputForm
            value={value.nombre}
            name='Nombre'
            event={e=>setValue({...value,nombre:e})}
        />
        <InputForm     
            value={value.apPat}
            name='ap paterno'
            event={e=>setValue({...value,apPat:e})}
        />
        <InputForm 
          value={value.apMat}
          name='ap Materno'
          event={e=>setValue({...value,apMat:e})}
        />
        <br />
        <button onClick={sendNuevoUsuario}>enviar cambios usuario.</button>

    </div>)
}
